import React from 'react';

const BookingPage = () => {
  const bookArticleButtonStyle = {
    width: '15.8125rem',
    height: '5rem',
    flexShrink: 0,
    borderRadius: '2.5rem',
    background: 'rgba(255, 255, 255, 1)',
  };

  const selectMonthDropdownStyle = {
    width: '26.875rem',
    height: '5rem',
    flexShrink: 0,
    borderRadius: '2.5rem',
    background: 'rgba(255, 255, 255, 1)',
  };

  return (
    <div>
      <button style={bookArticleButtonStyle}>Book Article Button</button>
      <button style={selectMonthDropdownStyle}>Select Month Dropdown</button>
    </div>
  );
};

export default BookingPage;
